  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route exact path='/' element={<Login />} />
          <Route path='/register' element={<Register />} />
          <div className='container'>
            <Navbar />
            <div>
              <Route path='/home' element={<Home />} />
              {/* <Route path="/add-User/:id" element={<> <Navbar /><CreateUser /><Footer /> </>}></Route>
